import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './AuthContext';

// Import components
import Header from './components/common/Header';
import Footer from './components/common/Footer';
import Home from './pages/Home/Home';
import About from './pages/About/About';
import Services from './pages/Services/Services';
import ServiceDetail from './pages/Services/ServiceDetail';
import Careers from './pages/Careers/Careers';
import Blog from './pages/Blog/Blog';
import Contact from './pages/Contact/Contact';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import Dashboard from './pages/Dashboard/Dashboard';
import NotFound from './pages/NotFound/NotFound';

// Import your styles
import './styles/globals.css';

// Layout wrapper component
const Layout = ({ children }) => (
  <div className="flex flex-col min-h-screen">
    <Header />
    <main className="flex-grow">
      {children}
    </main>
    <Footer />
  </div>
);

// Simple page components for missing pages
const SimplePage = ({ title, description }) => (
  <div className="py-20 bg-gray-50">
    <div className="container px-4 mx-auto text-center">
      <h1 className="mb-6 text-4xl font-bold text-gray-800">{title}</h1>
      <p className="max-w-2xl mx-auto text-lg text-gray-600">{description}</p>
      <div className="mt-8">
        <button className="px-8 py-3 font-semibold text-white transition-colors bg-blue-600 rounded-lg hover:bg-blue-700">
          Learn More
        </button>
      </div>
    </div>
  </div>
);

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            {/* Routes with Layout (Header/Footer) */}
            <Route path="/" element={
              <Layout>
                <Home />
              </Layout>
            } />
            
            <Route path="/about" element={
              <Layout>
                <About />
              </Layout>
            } />
            
            <Route path="/services" element={
              <Layout>
                <Services />
              </Layout>
            } />
            
            <Route path="/services/:category" element={
              <Layout>
                <ServiceDetail />
              </Layout>
            } />
            
            <Route path="/careers" element={
              <Layout>
                <Careers />
              </Layout>
            } />
            
            <Route path="/blog" element={
              <Layout>
                <SimplePage 
                  title="Our Blog" 
                  description="Stay updated with the latest trends and insights in telecommunications technology and industry news."
                />
              </Layout>
            } />
            
            <Route path="/contact" element={
              <Layout>
                <Contact />
              </Layout>
            } />
            
            <Route path="/dashboard" element={
              <Layout>
                <Dashboard />
              </Layout>
            } />
            
            {/* Routes without Layout (Auth pages) */}
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            
            {/* 404 Route */}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
